import React from 'react';
import '../App.css'
import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';
import Accendre from '../assets/accendre.svg'

export function ProjectsScreen(props) {

    const projects = [
        {
            title: "Accendre", 
            description: "Over the last two years, I have worked on Accendre, a fitness tech startup aimed toward improving athletic performance through science-based training.",
            img: Accendre
        }
    ]




    return (
        <div
        className='homeScreen'
        >
            <h1>Projects</h1>
        <div className= 'projects' >

        {projects.map(item => {

            return (
                <Card >
                <Card.Img variant="top" src={item.img} />
                <Card.Body>
                  <Card.Title>{item.title}</Card.Title>
                  <Card.Text>
                    Some quick example text to build on the card title and make up the
                    bulk of the card's content.
                  </Card.Text>
                  <Button variant="outline-dark">Go somewhere</Button>
                </Card.Body>
              </Card>
            )}) }


        </div>

        </div>

        );

}
